#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow25::prelude::*;
assert_eq!(Path::new().is_empty(), true);

let p: Path = path!("/hi/ho");
assert_eq!(p.is_empty(), false);
# Ok::<(), PathError>(())
```

21.docs:
Creates a builder for [`Entry`].

# Examples

```
use willow25::prelude::*;

// Supplying incomplete data errors.
assert!(
    Entry::builder()
    .path(path!(""))
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .payload_digest([77; 32].into())
    // timestamp and payload_length are missing!
    .build().is_err()
);

// Supplying all necessary data yields an entry.
let entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!(""))
    .timestamp(12345)
    .payload_digest([77; 32].into())
    .payload_length(17)
    .build().unwrap();

assert_eq!(*entry.subspace_id(), [1; 32].into());
```

