Creates a `&'static` reference to the empty component.

```
use willow25::prelude::*;

assert_eq!(component!(""), Component::new_empty());
```

296.docs:
A helper struct for creating a [`Path`] with exactly one memory allocation. Requires total length and component count to be known in advance.

Enforces that each [`Component`] has a length of at most 4096 ([`MCL`]), that each [`Path`] has at most 4096 ([`MCC`]) [`Component`]s, and that the total size in bytes of all [`Component`]s is at most 4096 ([`MPL`]).

```
use willow25::prelude::*;
let mut builder = PathBuilder::new(4, 2)?;
builder.append_component(component!("hi"));
builder.append_slice(b"ho")?;
assert_eq!(builder.build(), path!("/hi/ho"));
# Ok::<(), PathError>(())
```

321.docs:
Creates a statically-known [`Component`](prelude::Component).

Use this macro when you need to create a statically known path component. You can specify the component as ascii:

```
# use willow25::prelude::*;
assert_eq!(component!("abc123-._~").as_bytes(), b"abc123-._~");
```

Bytes which are neither ascii alphanumerics nor the ascii encoding of one of `-._~` must be [percent-encoded](https://datatracker.ietf.org/doc/html/rfc3986#section-2.1): to encode the byte with hex representation `xy` (where `x` and `y` are ascii hex digits), write `%xy`. For example, to encode a forward slash (`/`), use `%2f`:

```
# use willow25::prelude::*;
assert_eq!(component!("abc%2fdef").as_bytes(), b"abc/def");
```

The macro causes a compile-time error if the supplied component is invalid.

```compile_fail
# use willow25::prelude::*;
// Component contains a character which must be percent-encoded.
let nope = component!(":");
```

```compile_fail
# use willow25::prelude::*;
// Component contains an invalid percent-encoding.
let nope = component!("%az");
```

```compile_fail
# use willow25::prelude::*;
// Component contains a character which must be percent-encoded.
let nope = component!(":");
```

```compile_fail
# use willow25::prelude::*;
// Component length must not exceed 4096 bytes.
let nope = component!("too_");
```

144.docs:
Sets the [payload_length](https://willowprotocol.org/specs/data-model/index.html#entry_payload_length) and [payload_digest](https://willowprotocol.org/specs/data-model/index.html#entry_payload_digest) of the entry being built to those of the given [Payload](https://willowprotocol.org/specs/data-model/index.html#Payload).

```
use willow25::prelude::*;

let entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!("/vacation/plan"))
    .timestamp(12345)
    .payload(b"See all the sights!")
    .build().unwrap();

assert_eq!(*entry.payload_digest(), [
    30, 72, 189, 217, 105, 47, 66, 151,
    107, 162, 70, 193, 110, 66, 169, 91,
    102, 134, 136, 3, 177, 198, 63, 147,
    147, 222, 117, 245, 149, 243, 155, 150,
].into());
assert_eq!(entry.payload_length(), 19);
```

446.docs:
Creates a new [`Path`] by appending a slice of [`Component`]s to `&self`.

Creates a fully separate copy of the new data on the heap; which includes cloning all data in `&self`. To efficiently construct [`Path`]s, use [`Path::from_components`], [`Path::from_slices`], [`Path::from_components_iter`], [`Path::from_slices_iter`], or a [`PathBuilder`].

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the resulting [`Path`] in bytes, and `m` is the number of its [`Component`]s. Performs a single allocation of `O(n + m)` bytes.

#### Examples

```
use willow25::prelude::*;
let p0: Path = Path::new();
let p1 = p0.append_slices(&[b"hi", b"ho"])?;
assert_eq!(
    p1.append_slices(&[b"too_"]),
    Err(PathError::PathTooLong),
);
# Ok::<(), PathError>(())
```

444.docs:
Creates a new [`Path`] by appending a [`Component`] to `&self`.

Creates a fully separate copy of the new data on the heap; which includes cloning all data in `&self`. To efficiently construct [`Path`]s, use [`Path::from_components`], [`Path::from_slices`], [`Path::from_components_iter`], [`Path::from_slices_iter`], or a [`PathBuilder`].

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the resulting [`Path`] in bytes, and `m` is the number of its [`Component`]s. Performs a single allocation of `O(n + m)` bytes.

#### Examples

```
use willow25::prelude::*;
let p0: Path = Path::new();
let p1 = p0.append_slice(b"hi")?;
let p2 = p1.append_slice(b"ho")?;
assert_eq!(
    p2.append_slice(b"too_"),
    Err(PathError::PathTooLong),
);
# Ok::<(), PathError>(())
```

467.docs:
Creates an iterator over all [prefixes](https://willowprotocol.org/specs/data-model/index.html#path_prefix) of `&self` (including the empty [`Path`] and `&self` itself).

Stepping the iterator takes `O(1)` time and performs no memory allocations.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");
let mut prefixes = p.all_prefixes();
assert_eq!(prefixes.next(), Some(Path::new()));
assert_eq!(prefixes.next(), Some(Path::from_slice(b"hi")?));
assert_eq!(prefixes.next(), Some(path!("/hi/ho")));
assert_eq!(prefixes.next(), None);
# Ok::<(), PathError>(())
```

440.docs:
Creates a singleton [`Path`], consisting of exactly one [`Component`], from a raw slice of bytes.

Copies the bytes into an owned allocation on the heap.

#### Complexity

Runs in `O(n)`, where `n` is the length of the [`Component`]. Performs a single allocation of `O(n)` bytes.

#### Examples

```
use willow25::prelude::*;
let p = Path::from_slice(b"hi")?;
assert_eq!(p.component_count(), 1);

assert_eq!(
    Path::from_slice(b"too_"),
    Err(PathError::ComponentTooLong),
);
# Ok::<(), PathError>(())
```

465.docs:
Creates a new [`Path`] that consists of the first `component_count` [`Component`]s of `&self`. More efficient than creating a new [`Path`] from scratch.

Returns [`None`] if `component_count` is greater than `self.get_component_count()`.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");
assert_eq!(p.create_prefix(0), Some(Path::new()));
assert_eq!(p.create_prefix(1), Some(Path::from_slice(b"hi")?));
assert_eq!(p.create_prefix(2), Some(path!("/hi/ho")));
assert_eq!(p.create_prefix(3), None);
# Ok::<(), PathError>(())
```

438.docs:
Returns an empty [`Path`], i.e., a [`Path`] of zero [`Component`]s.

#### Complexity

Runs in `O(1)`.

#### Examples

```
use willow25::prelude::*;
assert_eq!(Path::new().component_count(), 0);
assert_eq!(Path::new(), Path::default());
