132.docs:
Returns whether this entry would be [prefix pruned](https://willowprotocol.org/specs/data-model/index.html#prefix_pruning) by another entry.

Prefix pruning powers deletion in Willow: whenever a data store would contain two entries, one of which pruens the other, the other is removed from the data store (or never inserted in the first place). Informally speaking, newer entries remove older entries, but only if they are in the same namespace and subspace, and only if the path of the newer entry is a prefix of the path of the older entry.

More precisely: an entry `e1` prunes an entry `e2` if and only if

- `e1.namespace_id() == e2.namespace_id()`,
- `e1.subspace_id() == e2.subspace_id()`,
- `e1.path().is_prefix_of(e2.path())`, and
- `e1.is_newer_than(&e2)`.

This method is the reciprocal of [`EntrylikeExt::prunes`].

# Examples


```
use willow25::prelude::*;

let entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!("/a/b"))
    .timestamp(12345)
    .payload_digest([1; 32].into())
    .payload_length(17)
    .build().unwrap();

let newer = Entry::prefilled_builder(&entry).timestamp(99999).build().unwrap();
assert!(entry.is_pruned_by(&newer));
assert!(!newer.is_pruned_by(&entry));

let newer_and_prefix = Entry::prefilled_builder(&newer)
    .path(path!("/a")).build().unwrap();
assert!(entry.is_pruned_by(&newer_and_prefix));
assert!(!newer_and_prefix.is_pruned_by(&entry));

let newer_and_extension = Entry::prefilled_builder(&newer)
    .path(path!("/a/b/c")).build().unwrap();
assert!(!entry.is_pruned_by(&newer_and_extension));
assert!(!newer_and_extension.is_pruned_by(&entry));

let newer_but_unrelated_namespace = Entry::prefilled_builder(&newer)
    .namespace_id([17; 32].into()).build().unwrap();
assert!(!entry.is_pruned_by(&newer_but_unrelated_namespace));
assert!(!newer_but_unrelated_namespace.is_pruned_by(&entry));

let newer_but_unrelated_subspace = Entry::prefilled_builder(&newer)
    .subspace_id([3; 32].into()).build().unwrap();
assert!(!entry.is_pruned_by(&newer_but_unrelated_subspace));
assert!(!newer_but_unrelated_subspace.is_pruned_by(&entry));
# Ok::<(), PathError>(())
```

459.docs:
Returns an [owned handle](OwnedComponent) to the `i`-th component of `&self`, without checking whether `i < self.component_count()`.

#### Safety

Undefined behaviour if `i >= self.component_count()`.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");
assert_eq!(p.owned_component(0), Some(OwnedComponent::new(b"hi")?));
assert_eq!(p.owned_component(1), Some(OwnedComponent::new(b"ho")?));
assert_eq!(p.owned_component(2), None);
# Ok::<(), PathError>(())
```

130.docs:
Returns whether this entry would [prefix prune](https://willowprotocol.org/specs/data-model/index.html#prefix_pruning) another entry.

Prefix pruning powers deletion in Willow: whenever a data store would contain two entries, one of which pruens the other, the other is removed from the data store (or never inserted in the first place). Informally speaking, newer entries remove older entries, but only if they are in the same namespace and subspace, and only if the path of the newer entry is a prefix of the path of the older entry.

More precisely: an entry `e1` prunes an entry `e2` if and only if

- `e1.namespace_id() == e2.namespace_id()`,
- `e1.subspace_id() == e2.subspace_id()`,
- `e1.path().is_prefix_of(e2.path())`, and
- `e1.is_newer_than(&e2)`.

This method is the reciprocal of [`EntrylikeExt::is_pruned_by`].

# Examples


```
use willow25::prelude::*;

let entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!("/a/b"))
    .timestamp(12345)
    .payload_digest([1; 32].into())
    .payload_length(17)
    .build().unwrap();

let newer = Entry::prefilled_builder(&entry).timestamp(99999).build().unwrap();
assert!(!entry.prunes(&newer));
assert!(newer.prunes(&entry));

let newer_and_prefix = Entry::prefilled_builder(&newer)
    .path(path!("/a")).build().unwrap();
assert!(!entry.prunes(&newer_and_prefix));
assert!(newer_and_prefix.prunes(&entry));

let newer_and_extension = Entry::prefilled_builder(&newer)
    .path(path!("/a/b/c")).build().unwrap();
assert!(!entry.prunes(&newer_and_extension));
assert!(!newer_and_extension.prunes(&entry));

let newer_but_unrelated_namespace = Entry::prefilled_builder(&newer)
    .namespace_id([17; 32].into()).build().unwrap();
assert!(!entry.prunes(&newer_but_unrelated_namespace));
assert!(!newer_but_unrelated_namespace.prunes(&entry));

let newer_but_unrelated_subspace = Entry::prefilled_builder(&newer)
    .subspace_id([3; 32].into()).build().unwrap();
assert!(!entry.prunes(&newer_but_unrelated_subspace));
assert!(!newer_but_unrelated_subspace.prunes(&entry));
# Ok::<(), PathError>(())
```

432.docs:
Creates a statically-known [`Path`](prelude::Path).

Use this macro when you need to create a statically known path. A `/` indicates a new component, the component contents can be specified as ascii:

```
# use willow25::prelude::*;
assert_eq!(path!("/blog/ideas"), Path::from_slices(&[b"blog", b"ideas"])?);
# Ok::<(), PathError>(())
```

Components have the same syntax as the [`component!`](component) macro: their bytes can be given as ascii if they are ascii alphanumerics or the ascii encoding of one of `-._~`, all other bytes must be [percent-encoded](https://datatracker.ietf.org/doc/html/rfc3986#section-2.1).

```
# use willow25::prelude::*;
assert_eq!(path!("/abc%3d/def%2f"), Path::from_slices(&[b"abc=", b"def/"])?);
# Ok::<(), PathError>(())
```

The empty path is given via the empty string literal, a single slash results in the path consisting of exactly one empty component, and so on.

```
# use willow25::prelude::*;
assert_eq!(path!(""), Path::from_slices(&[])?);
assert_eq!(path!("/"), Path::from_slices(&[&[]])?);
assert_eq!(path!("//"), Path::from_slices(&[&[], &[]])?);
assert_eq!(path!("/hi/"), Path::from_slices(&[b"hi".as_slice(), &[].as_slice()])?);
# Ok::<(), PathError>(())
```

The macro causes a compile-time error if the supplied path is invalid.

```compile_fail
# use willow25::prelude::*;
// Component length must not exceed 4096 bytes.
let nope = path!("/too_");
```

```compile_fail
# use willow25::prelude::*;
// Component count must not exceed 4096.
let nope = path!("");
```

```compile_fail
# use willow25::prelude::*;
// Total path length must not exceed 4096 bytes.
let nope = path!("");
```

457.docs:
Returns the `i`-th [`Component`] of `&self`, without checking whether `i < self.component_count()`.

#### Safety

Undefined behaviour if `i >= self.component_count()`.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");
assert_eq!(unsafe { p.component_unchecked(0) }, component!("hi"));
assert_eq!(unsafe { p.component_unchecked(1) }, Component::new(b"ho")?);
# Ok::<(), PathError>(())
```

3.docs:
An immutable Willow [Path](https://willowprotocol.org/specs/data-model/index.html#Path). Thread-safe, cheap to clone, cheap to take prefixes of, expensive to append to (linear time complexity).

A Willow25 Path is any sequence of bytestrings  called [Components](https://willowprotocol.org/specs/data-model/index.html#Component)  fulfilling certain constraints:

- each [`Component`] has a length of at most 4096 ([`MCL`]),
- each [`Path`] has at most 4096 ([`MCC`]) components, and
- the total size in bytes of all [`Component`]s is at most 4096 ([`MPL`]).

This type statically enforces these invariants for all (safely) created instances.

Because appending [`Component`]s takes time linear in the length of the full [`Path`], you should not build up [`Path`]s this way. Instead, use [`Path::from_components`], [`Path::from_slices`], [`Path::from_components_iter`], [`Path::from_slices_iter`], or a [`PathBuilder`]. If you statically know the path in advance, use the [`path!`](path) macro.

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");

assert_eq!(p.component_count(), 2);
assert_eq!(p.component(1), Some(Component::new(b"ho")?));
assert_eq!(p.total_length(), 4);
assert!(p.is_prefixed_by(&Path::from_slice(b"hi")?));
assert_eq!(
    p.longest_common_prefix(&path!("/hi/he")),
    Path::from_slice(b"hi")?
);
# Ok::<(), PathError>(())
```

128.docs:
Returns whether this entry is strictly [newer](https://willowprotocol.org/specs/data-model/index.html#entry_newer) than another entry. See also [`EntrylikeExt::cmp_recency`] and [`EntrylikeExt::is_older_than`].

Comparing recency is primarily important to determine [which entries overwrite each other](https://willowprotocol.org/specs/data-model/index.html#prefix_pruning); the [`EntrylikeExt::prunes`] method checks for that directly.

# Examples

```
use willow25::prelude::*;

let entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!(""))
    .timestamp(12345)
    .payload_digest([1; 32].into())
    .payload_length(17)
    .build().unwrap();

assert!(!entry.is_newer_than(&entry));

let lesser_timestamp = Entry::prefilled_builder(&entry).timestamp(5).build().unwrap();
assert!(entry.is_newer_than(&lesser_timestamp));

let lesser_digest = Entry::prefilled_builder(&entry).payload_digest([0; 32].into()).build().unwrap();
assert!(entry.is_newer_than(&lesser_digest));

let lesser_length = Entry::prefilled_builder(&entry).payload_length(0).build().unwrap();
assert!(entry.is_newer_than(&lesser_length));

let greater_timestamp = Entry::prefilled_builder(&entry).timestamp(999999).build().unwrap();
assert!(!entry.is_newer_than(&greater_timestamp));

let greater_digest = Entry::prefilled_builder(&entry).payload_digest([2; 32].into()).build().unwrap();
assert!(!entry.is_newer_than(&greater_digest));

let greater_length = Entry::prefilled_builder(&entry).payload_length(99).build().unwrap();
assert!(!entry.is_newer_than(&greater_length));
```

455.docs:
Tests whether `&self` is [related](https://willowprotocol.org/specs/data-model/index.html#path_related) to the given [`Path`], that is, whether either one is a [prefix](https://willowprotocol.org/specs/data-model/index.html#path_prefix) of the other.

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the longer [`Path`] in bytes, and `m` is the greatest number of [`Component`]s.

#### Examples

```
use willow25::prelude::*;
let p: Path = Path::from_slice(b"hi")?;
assert!(p.is_related_to(&Path::new()));
assert!(p.is_related_to(&path!("/hi")));
assert!(p.is_related_to(&path!("/hi/ho")));
assert!(!p.is_related_to(&path!("/no")));
# Ok::<(), PathError>(())
```

1.docs:
The type of [SubspaceIds](https://willowprotocol.org/specs/data-model/index.html#SubspaceId) used by [Willow25](https://macromania--macromania.deno.dev/specs/willow25/index.html#willow25_data_model).

This is a thin wrapper around `[u8; SUBSPACE_ID_WIDTH]`.

```
use willow25::prelude::*;

let subspace_id = SubspaceId::from([17; SUBSPACE_ID_WIDTH]);
