299.docs:
Creates a builder for a [`Path`] of known total length and component count, efficiently prefilled with the first `prefix_component_count` [`Component`]s of a given `reference` [`Path`]. Panics if there are not enough [`Component`]s in the `reference`.

The missing component data must be filled in before building.

#### Complexity

Runs in `O(target_total_length + target_component_count)`, performs a single allocation of `O(total_length + component_count)` bytes.

```
use willow25::prelude::*;
let p = path!("/hi/he");
let mut builder = PathBuilder::new_from_prefix(4, 2, &p, 1)?;
builder.append_component(component!("ho"));
assert_eq!(builder.build(), path!("/hi/ho"));
# Ok::<(), PathError>(())
```

22.docs:
Creates a builder which is prefilled with the data from some other entry.

Use this function to create modified copies of entries.

# Examples

```
use willow25::prelude::*;

// Supplying all necessary data yields an entry.
let first_entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!(""))
    .timestamp(12345)
    .payload_digest([77; 32].into())
    .payload_length(17)
    .build().unwrap();

assert_eq!(*first_entry.payload_digest(), [77; 32].into());

let second_entry = Entry::prefilled_builder(&first_entry)
    .timestamp(67890)
    .payload_digest([78; 32].into())
    .payload_length(4)
    .build().unwrap();

assert_eq!(*second_entry.payload_digest(), [78; 32].into());
```

